import React from "react";
import { useSelector } from "react-redux";
import { Modal } from "antd";
import { useDispatch } from "react-redux";
import Head from "./Head";
import Body from "./Body";
import "./ReturnModal.css";

const ReturnModal = () => {
  const dispatch = useDispatch();
  const { detailRecipe, status } = useSelector((state) => state.detailRecipe);

  const { title = "", ingredients = {} } = detailRecipe;
  const {} = ingredients;
  console.log("ingredients: ", ingredients);

  const cancelHandle = () => {
    dispatch({ type: "CLOSE_RECIPE" });
  };

  return (
    <Modal
      wrapClassName=""
      // visible={true}
      visible={status}
      onCancel={cancelHandle}
      footer={null}
    >
      {/* <div>{detailRecipe?.publisher}</div> */}
      <div style={{ height: "650px", backgroundColor: "#ff00001f" }}>
        <Head title={title} />
        <Body />
      </div>
    </Modal>
  );
};

export default ReturnModal;
